var a:integer;
     Starttime: integer;
begin
Starttime:= Gettickcount;
if(isfkeydown(9))then
begin

repeat
  a:= 1+random(9999999);
  a:= a * 1;
  a:= a + 1+random(999999);
  wait(1+random(100));
  Writeln(inttostr(a));
until(gettickcount - Starttime > 5000);
writeln('DING!');
end;
end.[/scar]
